package pawanroy.leetcode.`1861-Rotating-the-box`

import org.junit.jupiter.api.Test
import kotlin.test.assertEquals

class SolutionTest {
    private val sol = Solution()

    @Test
    fun caseOne() {
        assertEquals(
            arrayOf(
                charArrayOf('#', '.'),
                charArrayOf('#', '#'),
                charArrayOf('*', '*'),
                charArrayOf('.', '.')
            ), sol.rotateTheBox(
                arrayOf(charArrayOf('#', '.', '*', '.'), charArrayOf('#', '#', '*', '.'))
            )
        )
    }

    @Test
    fun caseTwo() {
        assertEquals(
            arrayOf(
                charArrayOf('.', '#', '#'),
                charArrayOf('.', '#', '#'),
                charArrayOf('#', '#', '*'),
                charArrayOf('#', '*', '.'),
                charArrayOf('#', '.', '*'),
                charArrayOf('#', '.', '.')
            ),
            sol.rotateTheBox(
                arrayOf(
                    charArrayOf('#', '#', '*', '.', '*', '.'),
                    charArrayOf('#', '#', '#', '*', '.', '.'),
                    charArrayOf('#', '#', '#', '.', '#', '.')
                )
            )
        )

    }

